title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o14244.m30 -> o14249.m23 -> o14244.m25 -> o14244.m30
  o14249.m23 -> o14244.m25 -> o14244.m30 -> o14249.m23
  o14244.m25 -> o14244.m30 -> o14249.m23 -> o14244.m25
  o14271.m0 -> o14252.m8 -> o14271.m0
  o14252.m8 -> o14271.m0 -> o14252.m8

features:
  - inheritance
  - overriding
  - method
  - polymorphism

